import React, { useState, useEffect, useRef } from 'react';
import { Volume2, Send } from 'lucide-react';

const API_URL = 'http://localhost:5000/api';

function App() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const messagesEndRef = useRef(null);

  useEffect(() => {
    addBotMessage("Hello! I'm your Darija Medical Terms assistant. How can I help you today?");
  }, []);

  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const addBotMessage = (text, terms = null) => {
    setMessages(prevMessages => [...prevMessages, { text, isBot: true, terms }]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (input.trim() === '') return;

    setMessages(prevMessages => [...prevMessages, { text: input, isBot: false }]);
    setInput('');

    try {
      const response = await fetch(`${API_URL}/terms/search`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ query: input }),
      });
      const data = await response.json();

      if (data.terms && data.terms.length > 0) {
        addBotMessage("Here's what I found:", data.terms);
      } else {
        addBotMessage(data.message || "I couldn't find any matching terms. Can you try rephrasing?");
      }
    } catch (error) {
      console.error('Error processing query:', error);
      addBotMessage("I'm sorry, I'm having trouble processing your request. Please try again later.");
    }
  };

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  const speak = (text, lang) => {
    if ('speechSynthesis' in window) {
      const utterance = new SpeechSynthesisUtterance(text);

      // Try to find a voice that matches the language
      const voices = window.speechSynthesis.getVoices();
      const voice = voices.find(v => v.lang.startsWith(lang)) || voices.find(v => v.lang.startsWith('en'));

      if (voice) {
        utterance.voice = voice;
        utterance.lang = voice.lang;
      } else {
        console.warn(`No voice found for ${lang}, falling back to default`);
      }

      utterance.onstart = () => console.log('Speech started');
      utterance.onend = () => console.log('Speech ended');
      utterance.onerror = (event) => console.error('Speech error:', event.error);

      window.speechSynthesis.speak(utterance);
    } else {
      console.error('Text-to-speech not supported in this browser');
      alert('Text-to-speech is not supported in your browser.');
    }
  };

  return (
    <div className="container">
      <h1>Darija Medical Terms Chatbot</h1>
      <div className="chat-container">
        {messages.map((message, index) => (
          <div key={index} className={`message ${message.isBot ? 'bot' : 'user'}`}>
            <div className="message-content">
              <p>{message.text}</p>
              {message.terms && (
                <div>
                  {message.terms.map((term, termIndex) => (
                    <div key={termIndex} className="term-card">
                      <h3 className="term-title">{term.darija}</h3>
                      <p className="term-translation">English: {term.english}</p>
                      <p className="term-translation">French: {term.french}</p>
                      <p className="term-translation">Spanish: {term.spanish}</p>
                      <p className="term-translation">Dutch: {term.dutch}</p>
                      <p className="term-category">Category: {term.category}</p>
                      <div className="button-container">
                        <button onClick={() => speak(term.darija, 'ar')}>
                          <Volume2 size={16} /> Darija
                        </button>
                        <button onClick={() => speak(term.english, 'en')}>
                          <Volume2 size={16} /> English
                        </button>
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>
          </div>
        ))}
        <div ref={messagesEndRef} />
      </div>
      <form onSubmit={handleSubmit} className="input-form">
        <input
          type="text"
          value={input}
          onChange={(e) => setInput(e.target.value)}
          placeholder="Type your message here..."
        />
        <button type="submit">
          <Send size={16} /> Send
        </button>
      </form>
    </div>
  );
}

export default App;
